/* Iida Peltonen 2022 */

import Maa from "./Maa"

const Maalista = ({ maa }) => {
  return (
    <div>
      <ul>
        <li key={maa.name.official}>
          {maa.name.official}
          <button onClick={function (event) {
                return (
                    <>
                    <h1>{maa.name.common}</h1>
                      P채채kaupunki: {maa.capital} <br />
                      Alue: {maa.region} <br />
                      Aluekoodi: {maa.area} <br />
                      <h3>Kielet: </h3>
                      <div>
                        {Object.values(maa.languages).map(language => (
                          <p key={language}>{language}</p>
                        ))}
                      </div>
                      <img src={maa.flags.png} />
                    </>
                  )
          }}>N채yt채</button>
        </li>
      </ul>
    </div>
  )
}

export default Maalista
